import { ArrowBackIosOutlined } from "@material-ui/icons"
import "./list.scss"

export default function List() {
  return (
    <div>
        <span className="listTitle">Continue to watch</span>
        <div className="wrapper">
            <ArrowBackIosOutlined></ArrowBackIosOutlined>
        </div>
    </div>
  )
}
